import React from 'react';
import img from '../assets/home-bg.jpeg';

function Home() {
  return (
    <div class="relative isolate overflow-hidden bg-gray-900 h-screen w-screen arie-hidden">
      <img src={img} alt="bg home"/>
    <div className="absolute w-full h-full mx-auto py-8">
      <h1 className="text-4xl font-bold mb-4 text-slate-400">Demo Apps</h1>
      <p className="text-lg mb-6  text-white font-bold">Currently includes TrieApp</p>
    </div>
    </div>
  );
}

export default Home;
